// Proto file describing listing groups.

// Container for enum describing the levels of bidding category used in
// ListingGroupFilterDimension.
message ListingGroupFilterBiddingCategoryLevelEnum {
  // The level of the listing group filter bidding category.
  enum ListingGroupFilterBiddingCategoryLevel {
    // Not specified.
    UNSPECIFIED = 0;

    // Used for return value only. Represents value unknown in this version.
    UNKNOWN = 1;

    // Level 1.
    LEVEL1 = 2;

    // Level 2.
    LEVEL2 = 3;

    // Level 3.
    LEVEL3 = 4;

    // Level 4.
    LEVEL4 = 5;

    // Level 5.
    LEVEL5 = 6;
  }
}
